INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (279, NULL, 'Silver Escudo', 'Silver Escudo', '1864', '1868', 72, 0.4, 'The silver escudo was one of the currencies of Spain between 1864 and 1869. Some coins and banknotes were produced up to 1873. It was subdivided into 100 céntimos de escudo. The escudo replaced the real de vellon at a rate of 10 reales de vellon = 1 escudo.', NULL);
