INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (280, NULL, 'Real de Vellon', 'Real de Vellon', '1600', '1864', 279, 10, 'The Real de vellón was introduced in 1600 (made of billon, or less than half silver). In 1737 was fixed at ​1⁄20 dollar and equal to 34 maravedíes (hence 1 dollar = 20 reales = 680 maravedíes)', NULL);
