INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (74, '€', 'Euro', 'European euro', '1999-01-01', NULL, NULL, NULL, 'The name "Euro" was officially adopted on 16 December 1995 in Madrid. The euro was introduced to the financial markets as an accounting currency on 1 January 1999, replacing the former European Currency Unit (ECU) at a ratio of 1:1. Physical euro coins and banknotes entered into circulation on 1 January 2002, as the official currency of the Euro Zone original members, and by March 2002 it had completely replaced the former currencies.<br/>Central bank: <a href="http://www.ecb.europa.eu" target="_blank">European Central Bank</a><br/><a href="https://en.wikipedia.org/wiki/Template:Historical_currencies_of_the_European_Union" target="_blank">Conversion Rates</a> to the former national currencies.', 'Euro');
